hat determine how the object is displayed in the Cloud Search results page.", "$ref": "ObjectDisplayOptions" }, "freshnessOptions": { "description": "The freshness options for an object.", "$ref": "FreshnessOptions" } }, "id": "ObjectOptions", "type": "object", "description": "The options for an object." }, "GroupId": { "id": "GroupId", "type": "object", "description": "Id representing a group that could be a space, a chat, or a direct message space. Which ID is set here will determine which group", "properties": { "dmId": { "$ref": "DmId", "description": "Unique, immutable ID of the Direct Message Space" }, "spaceId": { "$ref": "SpaceId", "description": "Unique, immutable ID of the Space" } } }, "ListOperationsResponse": { "description": "The response message for Operations.ListOperations.", "id": "ListOperationsResponse", "properties": { "operations": { "type": "array", "description": "A list of operations that matches the specified filter in the request.", "items": { "$ref": "Operation" } }, "nextPageToken": { "type": "string", "description": "The standard List next-page token." } }, "type": "object" }, "BooleanOperatorOptions": { "description": "Used to provide a search operator for boolean properties. This is optional. Search operators let users restrict the query to specific fields relevant to the type of item being searched.", "id": "BooleanOperatorOptions", "properties": { "operatorName": { "description": "Indicates the operator name required in the query in order to isolate the boolean property. For example, if operatorName is *closed* and the property's name is *isClosed*, then queries like *closed:\u003cvalue\u003e* show results only where the value of the property named *isClosed* matches *\u003cvalue\u003e*. By contrast, a search that uses the same *\u003cvalue\u003e* without an operator returns all items where *\u003cvalue\u003e* matches the value of any String properties or text within the content field for the item. The operator name can only contain lowercase letters (a-z). The maximum length is 32 characters.", "type": "string" } }, "type": "object" }, "UserId": { "description": "Primary key for User resource.", "id": "UserId", "type": "object", "properties": { "id": { "type": "string", "description": "Opaque, server-assigned ID of the User." }, "type": { "type": "string", "enumDescriptions": [ "Notes on HUMAN type: 1) Leaving UserId.UserType field empty will return HUMAN as default value. This is expected because all the existing UserIds are without explicitly setting UserType, most of which are HUMAN Ids. For Bot Ids we will always set BOT in UserType field. 2) DO NOT explicitly set HUMAN as type. This is a proto2 issue, that a UserId with explicitly set default value HUMAN as type is NOT equal to an id without setting the field. aka. UserId id1 = UserId.newBuilder() .setId(\"dummy\").setType(UserType.HUMAN).build(); UserId id2 = UserId.newBuilder().setId(\"dummy\").build(); AssertThat(id1).isNotEqual(id2); AssertThat(id2.getType()).isEqualTo(UserType.HUMAN);", "" ], "enum": [ "HUMAN", "BOT" ], "description": "Clients do not need to send UserType to Backend, but Backend will always send this field to clients per the following rule: 1. For HUMAN Ids, the field is empty but by default .getType() will return HUMAN. 2. For BOT Ids, the field is ALWAYS set to BOT." }, "actingUserId": { "description": "Optional. Opaque, server-assigned ID of the user profile associated with App/user acting on behalf of the human user. This is currently only set when a 3P application is acting on the user's behalf.", "type": "string" }, "originAppId": { "$ref": "AppId", "description": "Optional. Identifier of the App involved (directly or on behalf of a human creator) in creating this message. This is not set if the user posted a message directly, but is used in the case of, for example, a message being generated by a 1P integration based on a user action (creating an event, creating a task etc). This should only be used on the BE