n enum value of google.rpc.Code.", "format": "int32" }, "message": { "description": "A developer-facing error message, which should be in English. Any user-facing error message should be localized and sent in the google.rpc.Status.details field, or localized by the client.", "type": "string" } } }, "GetCustomerSearchApplicationStatsResponse": { "properties": { "stats": { "description": "Search application stats by date.", "items": { "$ref": "CustomerSearchApplicationStats" }, "type": "array" }, "averageSearchApplicationCount": { "description": "Average search application count for the given date range.", "type": "string", "format": "int64" } }, "description": "Response format for search application stats for a customer.", "type": "object", "id": "GetCustomerSearchApplicationStatsResponse" }, "ScoringConfig": { "type": "object", "id": "ScoringConfig", "properties": { "disableFreshness": { "type": "boolean", "description": "Whether to use freshness as a ranking signal. By default, freshness is used as a ranking signal. Note that this setting is not available in the Admin UI." }, "disablePersonalization": { "type": "boolean", "description": "Whether to personalize the results. By default, personal signals will be used to boost results." } }, "description": "Scoring configurations for a source while processing a Search or Suggest request." }, "TextValues": { "id": "TextValues", "type": "object", "description": "List of text values.", "properties": { "values": { "description": "The maximum allowable length for text values is 2048 characters.", "type": "array", "items": { "type": "string" } } } }, "SourceCrowdingConfig": { "type": "object", "id": "SourceCrowdingConfig", "description": "Set search results crowding limits. Crowding is a situation in which multiple results from the same source or host \"crowd out\" other results, diminishing the quality of search for users. To foster better search quality and source diversity in search results, you can set a condition to reduce repetitive results by source.", "properties": { "numSuggestions": { "format": "int32", "description": "Maximum number of suggestions allowed from a source. No limits will be set on results if this value is less than or equal to 0.", "type": "integer" }, "numResults": { "format": "int32", "type": "integer", "description": "Maximum number of results allowed from a datasource in a result page as long as results from other sources are not exhausted. Value specified must not be negative. A default value is used if this value is equal to 0. To disable crowding, set the value greater than 100." } } }, "Operation": { "type": "object", "properties": { "response": { "description": "The normal response of the operation in case of success. If the original method returns no data on success, such as `Delete`, the response is `google.protobuf.Empty`. If the original method is standard `Get`/`Create`/`Update`, the response should be the resource. For other methods, the response should have the type `XxxResponse`, where `Xxx` is the original method name. For example, if the original method name is `TakeSnapshot()`, the inferred response type is `TakeSnapshotResponse`.", "additionalProperties": { "type": "any", "description": "Properties of the object. Contains field @type with type URL." }, "type": "object" }, "done": { "type": "boolean", "description": "If the value is `false`, it means the operation is still in progress. If `true`, the operation is completed, and either `error` or `response` is available." }, "error": { "description": "The error result of the operation in case of failure or cancellation.", "$ref": "Status" }, "metadata": { "type": "object", "additionalProperties": { "description": "Properties of the object. Contains field @type with type URL.", "type": "any" }, "description": "Service-specific metadata associated with the operation. It typically contains progress information and common metadata such as create time. Some services might not provide such metadata