e item. Interactions are used to improve Search quality, but are not exposed to end users. The maximum number of elements is 1000.", "type": "array", "items": { "$ref": "Interaction" } }, "hash": { "type": "string", "description": "Hashing value provided by the API caller. This can be used with the items.push method to calculate modified state. The maximum length is 2048 characters." }, "sourceRepositoryUrl": { "type": "string", "description": "Link to the source repository serving the data. Seach results apply this link to the title. Whitespace or special characters may cause Cloud Seach result links to trigger a redirect notice; to avoid this, encode the URL. The maximum length is 2048 characters." }, "title": { "type": "string", "description": "The title of the item. If given, this will be the displayed title of the Search result. The maximum length is 2048 characters." }, "updateTime": { "format": "google-datetime", "description": "The time when the item was last modified in the source repository.", "type": "string" }, "objectType": { "type": "string", "description": "The type of the item. This should correspond to the name of an object definition in the schema registered for the data source. For example, if the schema for the data source contains an object definition with name 'document', then item indexing requests for objects of that type should set objectType to 'document'. The maximum length is 256 characters." }, "searchQualityMetadata": { "description": "Additional search quality metadata of the item", "$ref": "SearchQualityMetadata" }, "contentLanguage": { "type": "string", "description": "The BCP-47 language code for the item, such as \"en-US\" or \"sr-Latn\". For more information, see http://www.unicode.org/reports/tr35/#Unicode_locale_identifier. The maximum length is 32 characters." }, "keywords": { "items": { "type": "string" }, "description": "Additional keywords or phrases that should match the item. Used internally for user generated content. The maximum number of elements is 100. The maximum length is 8192 characters.", "type": "array" }, "containerName": { "type": "string", "description": "The name of the container for this item. Deletion of the container item leads to automatic deletion of this item. Note: ACLs are not inherited from a container item. To provide ACL inheritance for an item, use the inheritAclFrom field. The maximum length is 1536 characters." } }, "type": "object", "id": "ItemMetadata" }, "HtmlValues": { "id": "HtmlValues", "properties": { "values": { "items": { "type": "string" }, "type": "array", "description": "The maximum allowable length for html values is 2048 characters." } }, "type": "object", "description": "List of html values." }, "DatePropertyOptions": { "description": "The options for date properties.", "id": "DatePropertyOptions", "properties": { "operatorOptions": { "$ref": "DateOperatorOptions", "description": "If set, describes how the date should be used as a search operator." } }, "type": "object" }, "MatchRange": { "type": "object", "description": "Matched range of a snippet [start, end).", "id": "MatchRange", "properties": { "start": { "type": "integer", "description": "Starting position of the match in the snippet.", "format": "int32" }, "end": { "type": "integer", "description": "End of the match in the snippet.", "format": "int32" } } }, "SearchQualityMetadata": { "id": "SearchQualityMetadata", "type": "object", "description": "Additional search quality metadata of the item.", "properties": { "quality": { "type": "number", "format": "double", "description": "An indication of the quality of the item, used to influence search quality. Value should be between 0.0 (lowest quality) and 1.0 (highest quality). The default value is 0.0." } } }, "FacetBucket": { "type": "object", "description": "A bucket in a facet is the basic unit of operation. A bucket can comprise either a single value OR a contiguous range of values, depending on the type of the field bucketed. FacetBucket is currently used only for returning the response object.", "id": "FacetBucket", "properties": { "count": { "type": "integer", "format": "int32", "description": "Number of results that match the bucket value. Counts are only returned for searches when count accuracy is ensured. Cloud Search does not guarantee facet counts for any query and facet counts might be present only intermittently, even for identical queries. Do not build dependencies on facet count existence; instead use facet ount percentages which are always returned." }, "value": { "$ref": "Value" }, "percentage": { "format": "int32", "description": "Percent of results that match the bucket value. The returned value is between (0-100], and is rounded down to an integer if fractional. If the value is not explicitly returned, it represents a percentage value that rounds to 0. Percentages are returned for all searches, but are an estimate. Because percentages are always returned, you should render percentages instead of counts.", "type": "integer" } } }, "GetCustomerSessionStatsResponse": { "type": "object", "id": "GetCustomerSessionStatsResponse", "properties": { "stats": { "items": { "$ref": "CustomerSessionStats" }, "type": "array" } } }, "GetSearchApplicationSessionStatsResponse": { "type": "object", "properties": { "stats": { "type": "array", "items": { "$ref": "SearchApplicationSessionStats" } } }, "id": "GetSearchApplicationSessionStatsResponse" }, "SourceScoringConfig": { "description": "Set the scoring configuration. This allows modifying the ranking of results for a source.", "id": "SourceScoringConfig", "properties": { "sourceImportance": { "description": "Importance of the source.", "enumDescriptions": [ "", "", "" ], "enum": [ "DEFAULT", "LOW", "HIGH" ], "type": "string" } }, "type": "object" }, "BooleanPropertyOptions": { "id": "BooleanPropertyOptions", "properties": { "operatorOptions": { "description": "If set, describes how the boolean should be used as a search operator.", "$ref": "BooleanOperatorOptions" } }, "type": "object", "description": "The options for boolean properties." }, "AppId": { "id": "AppId", "type": "object", "properties": { "gsuiteAppType": { "description": "Enum indicating which 1P App this is when app_type is GSUITE_APP. Determined & set by the 1P API as a convenience for all users of this identifier(Eg. clients, chime, backend etc.) to map to 1P properties.", "enum": [ "GSUITE_APP_TYPE_UNSPECIFIED", "TASKS_APP", "CALENDAR_APP", "DOCS_APP", "SHEETS_APP", "SLIDES_APP", "MEET_APP", "ASSISTIVE_SUGGESTION_APP", "CONTACTS_APP", "ACTIVITY_FEED_APP", "DRIVE_APP" ], "type": "string", "enumDescriptions": [ "", "", "", "", "", "", "", "Powered by Bullseye", "", "", "" ] }, "id": { "type": "string", "format": "int64", "description": "Numeric identifier of the App. Set to Project number for 1/3P Apps. For Webhook, this is WebhookId. Determined & set by the 1P API from App credentials on the side channel." }, "appType": { "enumDescriptions": [ "", "3P APP eg. external Bots(Asana Bot), 1P Bots(Drive Bot).", "1P APP eg. Tasks, Meet, Docs, Calendar..", "Asynchronous messages via an incoming webhook." ], "description": "Enum indicating the type of App this is.", "enum": [ "APP_TYPE_UNSPECIFIED", "APP", "GSUITE_APP", "INCOMING_WEBHOOK" ], "type": "string" } }, "description": "Identifier of an App." }, "DriveLocationRestrict": { "id": "DriveLocationRestrict", "properties": { "type": { "enum": [ "UNSPECIFIED", "TRASHED", "STARRED" ], "type": "string", "enumDescriptions": [ "", "", "" ] } }, "description": "Drive location search restricts (e.g. \"is:starred\").", "type": "object" }, "TimestampOperatorOptions": { "properties": { "greaterThanOperatorName": { "type": "string", "description": "Indicates the operator name required in the query in order to isolate the timestamp property using the greater-than operator. For example, if greaterThanOperatorName is *closedafter* and the property's name is *closeDate*, then queries like *closedafter:\u003cvalue\u003e* show results only where the value of the property named *closeDate* is later than *\u003cvalue\u003e*. The operator name can only contain lowercase letters (a-z). The maximum length is 32 characters." }, "operatorName": { "type": "string", "description": "Indicates the operator name required in the query in order to isolate the timestamp property. For example, if operatorName is *closedon* and the property's name is *closeDate*, then queries like *closedon:\u003cvalue\u003e* show results only where the value of the property named *closeDate* matches *\u003cvalue\u003e*. By contrast, a search that uses the same *\u003cvalue\u003e* without an operator returns all items where *\u003cvalue\u003e* matches the value of any String properties or text within the content field for the item. The operator name can only contain lowercase letters (a-z). The maximum length is 32 characters." }, "lessThanOperatorName": { "description": "Indicates the operator name required in the query in order to isolate the timestamp property using the less-than operator. For example, if lessThanOperatorName is *closedbefore* and the property's name is *closeDate*, then queries like *closedbefore:\u003cvalue\u003e* show results only where the value of the property named *closeDate* is earlier than *\u003cvalue\u003e*. The operator name can only contain lowercase letters (a-z). The maximum length is 32 characters.", "type": "string" } }, "type": "object", "id": "TimestampOperatorOptions", "description": "Used to provide a search operator for timestamp properties. This is optional. Search operators let users restrict the query to specific fields relevant to the type of item being searched." }, "CustomEmoji": { "type": "object", "properties": { "updateTimeMicros": { "format": "int64", "type": "string" }, "readToken": { "type": "string", "description": "Opaque token that clients use to construct the URL for accessing the custom emojis image data. This field is intended for API consumption, and should *never* be persisted to Spanner." }, "creatorUserId": { "$ref": "UserId", "description": "This field should *never* be persisted to Spanner." }, "ownerCustomerId": { "$ref": "CustomerId", "description": "This field should *never* be persisted to Spanner." }, "state": { "description": "Snapshot of the current state of the emoji, which may differ from the source-of-truth in the CustomEmojis table. This field should *never* be persisted to Spanner.", "type": "string", "enum": [ "EMOJI_STATE_UNSPECIFIED", "EMOJI_ENABLED", "EMOJI_SYSTEM_DISABLED", "EMOJI_HIDDEN", "EMOJI_DELETED" ], "enumDescriptions": [ "", "Emoji is visible and available to be used, subject to access control requirements.", "Emoji can no longer be used (e.g. due to a shortcode conflict), but is not removed from existing embeddings.", "Emoji is hidden from pickers, so new usages are not allowed, but is not removed from existing embeddings.", "Emoji is removed everywhere and is not available to end-users." ] }, "createTimeMicros": { "type": "string", "description": "Time when the Emoji was created, in microseconds. This field may be present in Spanner, within the server, or in public APIs.", "format": "int64" }, "uuid": { "type": "string", "description": "Unique key for a custom emoji resource. Required. This field is *always* populated." }, "shortcode": { "description": "User-provided, human-readable ID for the custom emoji. Users are expected to observe this field in the UI instead of the UUID. This shortcode should be unique within an organization, but has no global uniqueness guarantees, unlike the UUID. This field should *never* be persisted to Spanner.", "type": "string" }, "blobId": { "type": "string", "description": "ID for the underlying image data in Blobstore. This field should *only* be present in Spanner or within the server, but should not be exposed in public APIs." }, "deleteTimeMicros": { "description": "Time when the emoji was deleted, in microseconds. This field may be present in Spanner, within the server, or in public APIs. Only present if the emoji has been deleted.", "format": "int64", "type": "string" }, "ephemeralUrl": { "description": "Output only. A short-lived URL clients can use for directly accessing a custom emoji image. This field is intended for API consumption, and should *never* be persisted to Spanner.", "type": "string", "readOnly": true }, "contentType": { "description": "Content type of the file used to upload the emoji. Used for takeout. Written to Spanner when the emoji is created.", "type": "string" } }, "id": "CustomEmoji", "description": "Proto representation of a custom emoji. May be used in both APIs and in Spanner, but certain fields should be restricted to one or the other. See the per-field documentation for details. NEXT_TAG: 14" }, "IntegerValues": { "description": "List of integer values.", "type": "object", "id": "IntegerValues", "properties": { "values": { "items": { "type": "string", "format": "int64" }, "type": "array" } } }, "VideoInfo": { "description": "Next tag: 2", "properties": { "duration": { "description": "Duration of the video in milliseconds. This field can be absent for recently uploaded video or inaccurate sometimes.", "type": "integer", "format": "int32" } }, "id": "VideoInfo", "type": "object" }, "DriveMimeTypeRestrict": { "description": "Drive mime-type search restricts (e.g. \"type:pdf\").", "type": "object", "properties": { "type": { "type": "string", "enumDescriptions": [ "", "", "", "", "", "", "", "", "", "", "", "", "", "", "" ], "enum": [ "UNSPECIFIED", "PDF", "DOCUMENT", "PRESENTATION", "SPREADSHEET", "FORM", "DRAWING", "SCRIPT", "MAP", "IMAGE", "AUDIO", "VIDEO", "FOLDER", "ARCHIVE", "SITE" ] } }, "id": "DriveMimeTypeRestrict" }, "Source": { "id": "Source", "description": "Defines sources for the suggest/search APIs.", "properties": { "name": { "description": "Source name for content indexed by the Indexing API.", "type": "string" }, "predefinedSource": { "enumDescriptions"