d data object that should conform to a registered object definition in the schema for the data source.", "$ref": "StructuredDataObject" }, "hash": { "type": "string", "description": "Hashing value provided by the API caller. This can be used with the items.push method to calculate modified state. The maximum length is 2048 characters." } }, "id": "ItemStructuredData" }, "SearchItemsByViewUrlRequest": { "type": "object", "properties": { "pageToken": { "type": "string", "description": "The next_page_token value returned from a previous request, if any." }, "debugOptions": { "description": "Common debug options.", "$ref": "DebugOptions" }, "viewUrl": { "type": "string", "description": "Specify the full view URL to find the corresponding item. The maximum length is 2048 characters." } }, "id": "SearchItemsByViewUrlRequest" }, "ListQuerySourcesResponse": { "id": "ListQuerySourcesResponse", "properties": { "sources": { "items": { "$ref": "QuerySource" }, "type": "array" }, "nextPageToken": { "type": "string" } }, "type": "object", "description": "List sources response." }, "DoubleValues": { "description": "List of double values.", "properties": { "values": { "type": "array", "items": { "format": "double", "type": "number" } } }, "type": "object", "id": "DoubleValues" }, "Media": { "description": "Media resource.", "id": "Media", "type": "object", "properties": { "resourceName": { "description": "Name of the media resource.", "type": "string" } } }, "DriveTimeSpanRestrict": { "description": "The time span search restrict (e.g. \"after:2017-09-11 before:2017-09-12\").", "properties": { "type": { "enum": [ "UNSPECIFIED", "TODAY", "YESTERDAY", "LAST_7_DAYS", "LAST_30_DAYS", "LAST_90_DAYS" ], "type": "string", "enumDescriptions": [ "", "", "", "", "Not Enabled", "Not Enabled" ] } }, "id": "DriveTimeSpanRestrict", "type": "object" }, "UnmappedIdentity": { "type": "object", "id": "UnmappedIdentity", "properties": { "resolutionStatusCode": { "description": "The resolution status 