he possible EnumValuePairs are used to rank results. If specified, integer values must be provided for all possible EnumValuePair values given for this property. Can only be used if isRepeatable is false." }, "possibleValues": { "type": "array", "description": "The list of possible values for the enumeration property. All EnumValuePairs must provide a string value. If you specify an integer value for one EnumValuePair, then all possible EnumValuePairs must provide an integer value. Both the string value and integer value must be unique over all possible values. Once set, possible values cannot be removed or modified. If you supply an ordered ranking and think you might insert additional enum values in the future, leave gaps in the initial integer values to allow adding a value in between previously registered values. The maximum number of elements is 100.", "items": { "$ref": "EnumValuePair" } }, "operatorOptions": { "$ref": "EnumOperatorOptions", "description": "If set, describes how the enum should be used as a search operator." } } }, "SearchApplicationUserStats": { "properties": { "thirtyDaysActiveUsersCount": { "type": "string", "description": "The count of unique active users in the past thirty days", "format": "int64" }, "sevenDaysActiveUsersCount": { "description": "The count of unique active users in the past seven days", "type": "string", "format": "int64" }, "date": { "$ref": "Date", "description": "The date for which session stats were calculated. Stats calculated on the next day close to midnight are returned." }, "oneDayActiveUsersCount": { "format": "int64", "type": "string", "description": "The count of unique active users in the past one day" } }, "type": "object", "id": "SearchApplicationUserStats" }, "ItemStatus": { "type": "object", "id": "ItemStatus", "properties": { "code": { "enum": [ "CODE_UNSPECIFIED", "ERROR", "MODIFIED", "NEW_ITEM", "ACCEPTED" ], "type": "string", "enumDescriptions": [ "Input-only value. Used with Items.list to list all items in the queue, regardless of status.", "Error encountered by Cloud Search while processing this item. Details of the error are in repositoryError.", "Item has been modified in the repository, and is out of date with the version previously accepted into Cloud Search.", "Item is known to exist in the repository, but is not yet accepted by Cloud Search. An item can be in this state when Items.push has been called for an item of this name that did not exist previously.", "API has accepted the up-to-date data of this item." ], "description": "Status code." }, "repositoryErrors": { "items": { "$ref": "RepositoryError" }, "description": "Repository error reported by connector.", "type": "array" }, "processingErrors": { "description": "Error details in case the item is in ERROR state.", "items": { "$ref": "ProcessingError" }, "type": "array" } }, "description": "This contains item's status and any errors." }, "SuggestResult": { "type": "object", "properties": { "peopleSuggestion": { "description": "This is present when the suggestion indicates a person. It contains more information about the person - like their email ID, name etc.", "$ref": "PeopleSuggestion" }, "suggestedQuery": { "description": "The suggested query that will be used for search, when the user clicks on the suggestion", "type": "string" }, "querySuggestion": { "description": "This field will be present if the suggested query is a word/phrase completion.", "$ref": "QuerySuggestion" }, "source": { "description": "The source of the suggestion.", "$ref": "Source" } }, "id": "SuggestResult", "description": "One suggestion result." }, "DataSource": { "id": "DataSource", "properties": { "disableServing": { "type": "boolean", "description": "Disable serving any search or assist results." }, "shortName": { "description": "A short name or alias for the source. This value will be used to match the 'source' operator. For example, if the short name is *\u003cvalue\u003e* then queries like *source:\u003cvalue\u003e* will only return results for this source. The value must be unique across all datasources. The value must only contain alphanumeric characters (a-zA-Z0-9). The value cannot start with 'google' and cannot be one of the following: mail, gmail, docs, drive, groups, sites, calendar, hangouts, gplus, keep, people, teams. Its maximum length is 32 characters.", "type": "string" }, "displayName": { "description": "Required. Display name of the datasource The maximum length is 300 characters.", "type": "string" }, "returnThumbnailUrls": { "type": "boolean", "description": "Can a user request to get thumbnail URI for Items indexed in this data source." }, "operationIds": { "description": "IDs of the Long Running Operations (LROs) currently running for this schema.", "items": { "type": "string" }, "type": "array" }, "name": { "description": "The name of the datasource resource. Format: datasources/{source_id}. The name is ignored when creating a datasource.", "type": "string" }, "disableModifications": { "description": "If true, sets the datasource to read-only mode. In read-only mode, the Indexing API rejects any requests to index or delete items in this source. Enabling read-only mode does not stop the processing of previously accepted data.", "type": "boolean" }, "itemsVisibility": { "description": "This field restricts visibility to items at the datasource level. Items within the datasource are restricted to the union of users and groups included in this field. Note that, this does not ensure access to a specific item, as users need to have ACL permissions on the contained items. This ensures a high level access on the entire datasource, and that the individual items are not shared outside this visibility.", "type": "array", "items": { "$ref": "GSuitePrincipal" } }, "indexingServiceAccounts": { "items": { "type": "string" }, "description": "List of service accounts that have indexing access.", "type": "array" } }, "description": "Datasource is a logical namespace for items to be indexed. All items must belong to a datasource. This is the prerequisite before items can be indexed into Cloud Search.", "type": "object" }, "PropertyDefinition": { "id": "PropertyDefinition", "properties": { "isRepeatable": { "description": "Indicates that multiple values are allowed for the property. For example, a document only has one description but can have multiple comments. Cannot be true for properties whose type is a boolean. If set to false, properties that contain more than one value cause the indexing request for that item to be rejected.", "type": "boolean" }, "displayOptions": { "description": "The options that determine how the property is displayed in the Cloud Search results page if it's specified to be displayed in the object's display options.", "$ref": "PropertyDisplayOptions" }, "datePropertyOptions": { "$ref": "DatePropertyOptions" }, "booleanPropertyOptions": { "$ref": "BooleanPropertyOptions" }, "enumPropertyOptions": { "$ref": "EnumPropertyOptions" }, "timestampPropertyOptions": { "$ref": "TimestampPropertyOptions" }, "textPropertyOptions": { "$ref": "TextPropertyOptions" }, "objectPropertyOptions": { "$ref": "ObjectPropertyOptions" }, "isWildcardSearchable": { "description": "Indicates that users can perform wildcard search for this property. Only supported for Text properties. IsReturnable must be true to set this option. In a given datasource maximum of 5 properties can be marked as is_wildcard_searchable.", "type": "boolean" }, "isFacetable": { "type": "boolean", "description": "Indicates that the property can be used for generating facets. Cannot be true for properties whose type is object. IsReturnable must be true to set this option. Only supported for boolean, enum, and text properties." }, "isSuggestable": { "description": "Indicates that the property can be used for generating query suggestions.", "type": "boolean" }, "htmlPropertyOptions": { "$ref": "HtmlPropertyOptions" }, "integerPropertyOptions": { "$ref": "IntegerPropertyOptions" }, "isSortable": { "type": "boolean", "description": "Indicates that the property can be used for sorting. Cannot be true for properties that are repeatable. Cannot be true for properties whose type is object. IsReturnable must be true to set this option. Only supported for boolean, date, double, integer, and timestamp properties." }, "name": { "description": "The name of the property. Item indexing requests sent to the Indexing API should set the property name equal to this value. For example, if name is *subject_line*, then indexing requests for document items with subject fields should set the name for that field equal to *subject_line*. Use the name as the identifier for the object property. Once registered as a property for an object, you cannot re-use this name for another property within that object. The name must start with a letter and can only contain letters (A-Z, a-z) or numbers (0-9). The maximum length is 256 characters.", "type": "string" }, "doublePropertyOptions": { "$ref": "DoublePropertyOptions" }, "isReturnable": { "type": "boolean", "description": "Indicates that the property identifies data that should be returned in search results via the Query API. If set to *true*, indicates that Query API users can use matching property fields in results. However, storing fields requires more space allocation and uses more bandwidth for search queries, which impacts performance over large datasets. Set to *true* here only if the field is needed for search results. Cannot be true for properties whose type is an object." } }, "description": "The definition of a property within an object.", "type": "object" }, "PhoneNumber": { "type": "object", "id": "PhoneNumber", "properties": { "type": { "enumDescriptions": [ "", "", "" ], "type": "string", "enum": [ "OTHER", "MOBILE", "OFFICE" ] }, "phoneNumber": { "description": "The phone number of the person.", "type": "string" } }, "description": "A person's Phone Number" }, "ItemAcl": { "id": "ItemAcl", "properties": { "owners": { "items": { "$ref": "Principal" }, "type": "array", "description": "Optional. List of owners for the item. This field has no bearing on document access permissions. It does, however, offer a slight ranking boosts items where the querying user is an owner. The maximum number of elements is 5." }, "aclInheritanceType": { "enumDescriptions": [ "The default value when this item does not inherit an ACL. Use NOT_APPLICABLE when inheritAclFrom is empty. An item without ACL inheritance can still have ACLs supplied by its own readers and deniedReaders fields.", "During an authorization conflict, the ACL of the child item determines its read access.", "During an authorization conflict, the ACL of the parent item specified in the inheritAclFrom field determines read access.", "Access is granted only if this item and the parent item specified in the inheritAclFrom field both permit read access." ], "enum": [ "NOT_APPLICABLE", "CHILD_OVERRIDE", "PARENT_OVERRIDE", "BOTH_PERMIT" ], "description": "Sets the type of access rules to apply when an item inherits its ACL from a parent. This should always be set in tandem with the inheritAclFrom field. Also, when the inheritAclFrom field is set, this field should be set to a valid AclInheritanceType.", "type": "string" }, "deniedReaders": { "type": "array", "items": { "$ref": "Principal" }, "description": "List of principals who are explicitly denied access to the item in search results. While principals are denied access by default, use denied readers to handle exceptions and override the list allowed readers. The maximum number of elements is 100." }, "readers": { "type": "array", "description": "List of principals who are allowed to see the item in search results. Optional if inheriting permissions from another item or if the item is not intended to be visible, such as virtual containers. The maximum number of elements is 1000.", "items": { "$ref": "Principal" } }, "inheritAclFrom": { "type": "string", "description": "The name of the item to inherit the Access Permission List (ACL) from. Note: ACL inheritance *only* provides access permissions to child items and does not define structural relationships, nor does it provide convenient ways to delete large groups of items. Deleting an ACL parent from the index only alters the access permissions of child items that reference the parent in the inheritAclFrom field. The item is still in the index, but may not visible in search results. By contrast, deletion of a container item also deletes all items that reference the container via the containerName field. The maximum length for this field is 1536 characters." } }, "type": "object", "description": "Access control list information for the item. For more information see [Map ACLs](https://developers.google.com/cloud-search/docs/guides/acls)." }, "GoogleDocsResultInfo": { "id": "GoogleDocsResultInfo", "type": "object", "properties": { "shareScope": { "description": "The visibility indicator in the UI will be based upon this.", "$ref": "ShareScope" }, "cosmoId": { "description": "The storage identifier for the object in Cosmo. This field is intended to used by Stratus/Moonshine integration only. It should not be exposed externally (please refer to encrypted_id for that purpose).", "$ref": "Id" }, "attachmentSha1": { "type": "string", "description": "The SHA1 hash of the object in Drive, if any." }, "encryptedId": { "type": "string", "description": "The encrypted (user-visible) id of this object. Knowing the id is sufficient to create a canonical URL for this document." }, "mimeType": { "description": "The mimetype of the document.", "type": "string" }, "cosmoNameSpace": { "format": "int32", "description": "For Cosmo objects, the Cosmo namespace the object was in. This allows downstream clients to identify whether a document was created in Writely or Kix, Presently or Punch, or whether it was uploaded from GDrive. See storage_cosmo.Id.NAME_SPACE for a list of all Cosmo name spaces.", "type": "integer" } }, "description": "A message containing information about a specific result. This information is passed to the scorer and beyond; in particular, GWS relies on it to format the result in the UI. Split from GoogleDocsMetadata in case we later want to reuse the message." }, "ErrorInfo": { "properties": { "errorMessages": { "items": { "$ref": "ErrorMessage" }, "type": "array" } }, "type": "object", "description": "Error information about the response.", "id": "ErrorInfo" }, "CustomerSessionStats": { "type": "object", "id": "CustomerSessionStats", "properties": { "date": { "description": "The date for which session stats were calculated. Stats are calculated on the following day, close to midnight PST, and then returned.", "$ref": "Date" }, "searchSessionsCount": { "description": "The count of search sessions on the day", "type": "string", "format": "int64" } } }, "PushItemRequest": { "id": "PushItemRequest", "type": "object", "properties": { "item": { "$ref": "PushItem", "description": "Item to push onto the queue." }, "connectorName": { "description": "The name of connector making this call. Format: datasources/{source_id}/connectors/{ID}", "type": "string" }, "debugOptions": { "$ref": "DebugOptions", "description": "Common debug options." } } }, "DataSourceRestriction": { "id": "DataSourceRestriction", "description": "Restriction on Datasource.", "properties": { "source": { "$ref": "Source", "description": "The source of restriction." }, "filterOptions": { "items": { "$ref": "FilterOptions" }, "description": "Filter options restricting the results. If multiple filters are present, they are grouped by object type before joining. Filters with the same object type are joined conjunctively, then the resulting expressions are joined disjunctively. The maximum number of elements is 20. NOTE: Suggest API supports only few filters at the moment: \"objecttype\", \"type\" and \"mimetype\". For now, schema specific filters cannot be used to filter suggestions.", "type": "array" } }, "type": "object" }, "TextOperatorOptions": { "properties": { "exactMatchWithOperator": { "description": "If true, the text value is tokenized as one atomic value in operator searches and facet matches. For example, if the operator name is \"genre\" and the value is \"science-fiction\" the query restrictions \"genre:science\" and \"genre:fiction\" doesn't match the item; \"genre:science-fiction\" does. Text value matching is case-sensitive and does not remove special characters. If false, the text is tokenized. For example, if the value is \"science-fiction\" the queries \"genre:science\" and \"genre:fiction\" matches the item.", "type": "boolean" }, "operatorName": { "type": "string", "description": "Indicates the operator name required in the query in order to isolate the text property. For example, if operatorName is *subject* and the property's name is *subjectLine*, then queries like *subject:\u003cvalue\u003e* show results only where the value of the property named *subjectLine* matches *\u003cvalue\u003e*. By contrast, a search that uses the same *\u003cvalue\u003e* without an operator returns all items where *\u003cvalue\u003e* matches the value of any text properties or text within the content field for the item. The operator name can only contain lowercase letters (a-z). The maximum length is 32 characters." } }, "id": "TextOperatorOptions", "type": "object", "description": "Used to provide a search operator for text properties. This is optional. Search operators let users restrict the query to specific fields relevant to the type of item being searched." }, "GetCustomerUserStatsResponse": { "properties": { "stats": { "items": { "$ref": "CustomerUserStats" }, "type": "array" } }, "type": "object", "id": "GetCustomerUserStatsResponse" }, "RetrievalImportance": { "id": "RetrievalImportance", "type": "object", "properties": { "importance": { "type": "string", "description": "Indicates the ranking importance given to property when i